import React from 'react';

function PerceptronSVG() {
  return (
    <svg width="800" height="400">
      {/* Input layer */}
      <circle cx="100" cy="100" r="30" fill="#ffffff" stroke="#000000" strokeWidth="2" />
      <text x="80" y="108" fontSize="14" fill="#000000">Input</text>

      {/* Hidden layer */}
      <circle cx="300" cy="100" r="30" fill="#ffffff" stroke="#000000" strokeWidth="2" />
      <text x="280" y="108" fontSize="14" fill="#000000">Hidden</text>

      {/* Output layer */}
      <circle cx="500" cy="100" r="30" fill="#ffffff" stroke="#000000" strokeWidth="2" />
      <text x="480" y="108" fontSize="14" fill="#000000">Output</text>

      {/* Input nodes */}
      <circle cx="100" cy="50" r="10" fill="#ffffff" stroke="#000000" strokeWidth="2" />
      <circle cx="100" cy="100" r="10" fill="#ffffff" stroke="#000000" strokeWidth="2" />
      <circle cx="100" cy="150" r="10" fill="#ffffff" stroke="#000000" strokeWidth="2" />

      {/* Hidden nodes */}
      <circle cx="300" cy="50" r="10" fill="#ffffff" stroke="#000000" strokeWidth="2" />
      <circle cx="300" cy="100" r="10" fill="#ffffff" stroke="#000000" strokeWidth="2" />
      <circle cx="300" cy="150" r="10" fill="#ffffff" stroke="#000000" strokeWidth="2" />

      {/* Output nodes */}
      <circle cx="500" cy="50" r="10" fill="#ffffff" stroke="#000000" strokeWidth="2" />
      <circle cx="500" cy="100" r="10" fill="#ffffff" stroke="#000000" strokeWidth="2" />
      <circle cx="500" cy="150" r="10" fill="#ffffff" stroke="#000000" strokeWidth="2" />

      {/* Connections (weights) */}
      <line x1="100" y1="50" x2="300" y2="50" stroke="#000000" strokeWidth="2" />
      <line x1="100" y1="100" x2="300" y2="50" stroke="#000000" strokeWidth="2" />
      <line x1="100" y1="150" x2="300" y2="50" stroke="#000000" strokeWidth="2" />

      <line x1="100" y1="50" x2="300" y2="100" stroke="#000000" strokeWidth="2" />
      <line x1="100" y1="100" x2="300" y2="100" stroke="#000000" strokeWidth="2" />
      <line x1="100" y1="150" x2="300" y2="100" stroke="#000000" strokeWidth="2" />

      <line x1="100" y1="50" x2="300" y2="150" stroke="#000000" strokeWidth="2" />
      <line x1="100" y1="100" x2="300" y2="150" stroke="#000000" strokeWidth="2" />
      <line x1="100" y1="150" x2="300" y2="150" stroke="#000000" strokeWidth="2" />

      {/* Formula */}
      <text x="100" y="200" fontSize="14" fill="#000000">Formula: y = f(w1*x1 + w2*x2 + w3*x3 + b)</text>
    </svg>
  );
}

export default PerceptronSVG;
